import React from 'react';

class ProfileStatus extends React.Component {
    render() {
        return (
            <div>
                <div>
                    <input type="text" value='Text' />
                </div>
                <div>
                    <span>Спанчик</span>
                </div>
            </div>
        )
    }
}

export default ProfileStatus
